import React, { Component } from 'react'
import ReactEcharts from 'echarts-for-react'
var option = {
    // title: {
    //     text: 'ECharts 入门示例'
    // },
    tooltip: {},
    legend: {
        data: ['销量']
    },
    xAxis: {
        data: ["衬衫", "羊毛衫", "雪纺衫", "裤子", "高跟鞋", "袜子"]
    },
    yAxis: {},
    series: [{
        name: '销量',
        type: 'bar',
        data: [5, 20, 36, 10, 10, 20]
    }]
};

class Echarts extends Component {
    render() {
        return (
            <div id='main'
                style={{
                    width: '300px',
                    height: '300px'
                }}
            >
                <h3>Echarts仪表盘</h3>
                <ReactEcharts
                    option={option}
                    notmerge={'true'}
                    lazyupdate={'false'}>
                </ReactEcharts>
            </div>
        )
    }
}
export default Echarts
